# Definition for singly-linked list.
class ListNode:
    def __init__(self,  x):
        self.val = x
        self.next = None


class Solution:
    def reorderList(self,  head: ListNode) -> None:
        """
        Do not return anything,  modify head in-place instead.
        """
        if head.next is None:
            return head

        inserted_next = head.next
        cur_1: ListNode = inserted_next
        inserted_pre = cur_2 = head

        while inserted_next.next is not None:
            # cur_1 represents the last one
            # cur_2 represents the one before the last
            while cur_1.next is not None:
                cur_2 = cur_2.next
                cur_1 = cur_1.next

            # insert last node after head
            inserted_pre.next = cur_1
            cur_1.next = inserted_next
            cur_2.next = None
            inserted_pre = inserted_next
            if inserted_next.next is not None:
                inserted_next = inserted_next.next
            cur_1 = inserted_next
            cur_2 = inserted_pre

        return head


